import React, { useState } from 'react';
import {
  TextInput,
} from 'react-native';
import styled from 'styled-components/native';


export default function Input({ placeholder, onChangeText }) {
  return (
    <TextInput
      placeholder={placeholder}
      onChangeText={onChangeText} />
  );
}
